import React, { Component } from 'react';
import classes from './Board.module.css';

class Board extends Component {
    render() {
        let tiles = [];
        for(let i=0;i<10;i++){
            for(let j=0;j<10;j++){
                if((i+j)%2 === 1) {
                    tiles.push(<div className={classes.DarkTile}></div>);
                } else {
                    tiles.push(<div className={classes.LightTile}></div>);
                }
            }
        }
        return(
            <div className={classes.Board}>

            </div>
        )
    }
}

export default Board;
